<?php

namespace RiskManager\CustomObjects\Entity;

use Base\Service\AbstractApiService;

class CustomObjects extends AbstractApiService{
    protected $id;
    protected $deleted;
    protected $name;
    protected $dataCreated;
    protected $dateUpdated;

    /**
     * @return mixed
     */
    public function getName()
    {
        return $this->name;
    }

    /**
     * @param mixed $name
     */
    public function setName($name)
    {
        $this->name = $name;
    }

    /**
     * @return mixed
     */
    public function getDataCreated()
    {
        return $this->dataCreated;
    }

    /**
     * @param mixed $dataCreated
     */
    public function setDataCreated($dataCreated)
    {
        $this->dataCreated = $dataCreated;
    }

    /**
     * @return mixed
     */
    public function getDateUpdated()
    {
        return $this->dateUpdated;
    }

    /**
     * @param mixed $dateUpdated
     */
    public function setDateUpdated($dateUpdated)
    {
        $this->dateUpdated = $dateUpdated;
    }

    /**
     * @return mixed
     */
    public function getDeleted()
    {
        return $this->deleted;
    }

    /**
     * @param mixed $deleted
     */
    public function setDeleted($deleted)
    {
        $this->deleted = $deleted;
    }

    /**
     * @return mixed
     */
    public function getId()
    {
        return $this->id;
    }

    /**
     * @param mixed $id
     */
    public function setId($id)
    {
        $this->id = $id;
    }


} 